import React from 'react';

export function Container({
    fluid,
    children
}) {
    return <div className={`container${fluid ? "-fluid" : ""}`}
    style={{ paddingTop: 20, top: '20%', left: '50%', position: 'relatve', paddingBottom: 20,}}>{children}</div>
}
